  [],\n\t\"revision_timestamp\": \"2015-05-06T21:46:59.721817\",\n\t\"name\": \"debugging-and-event-tracing-for-multi-agent-systems-project-08d22\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Large-scale agent systems have become a
  key part of in modeling and simulation tools such as NASA's Airspace Concept Evaluation
  System (ACES), an agent-based simulation of the National Airspace System (NAS).
  \ As distributed real-world systems comprised of many autonomous decision-making
  entities become more complex, so do their corresponding individual models and simulation
  systems.   However, existing tools for low-level single host debugging, data and
  event collection and local analysis do not adequately address the problem of understanding
  large distributed systems consisting of thousands of autonomously executing agents.
  In this Phase II effort, we propose to create a comprehensive semantic debugging
  and knowledge discovery and analysis system for agent-based simulations called IntelliTrace.
  \ The key innovation behind semantic and model driven system analysis is that it
  will bridge the gap between the semantics of model execution and the resultant implementation
  behavior realized within a software system.  We will use theses tools and capabilities
  to develop and demonstrate a methodology and approach for application-level analysis,
  knowledge and discovery and data mining and analysis.\",\n\t\"license_title\": \"U.S.
